<script>
    $(document).ready(function () {
        var messageValue = $(""#Status"").val();
        if (messageValue == 1) {
            $(""#Message"").addClass(""text-danger"").html(""Email đã được sử dụng. Hãy nhập email khác."");
        } else if (messageValue == 2) {
            $(""#Message"").addClass(""text-danger"").html(""Lỗi trong quá trình xử lý Server."");
        }
    });
    $(""#checkboxShow"").change(function () {
        if ($(this).is("":checked"")) {
            $(""#password"").attr(""type"", ""text"");
        } else {
            $(""#password"").attr(""type"", ""password"");
        }
    });
    function ValidateEmail(value){
        const pattern = /[^\x00-\x7F]/g;
        if (pattern.test(value)) {
            ShowMessage(""Vui lòng không nhập dữ liệu tiếng Việt có dấu."");
            return false
        }
        else if (value == """") {
            ShowMessage(""Vui lòng nhập Email"");
            return false
        }
        else {
            if (/^([a-zA-Z0-9_.+-])+\");
            WriteLiteral(@"@(([a-zA-Z0-9-])+\.)+([a-zA-Z0-9]{2,4})+$/.test(value)) {
                return true
            }
            ShowMessage(""Vui lòng nhập đúng định dạng email"")
            return false
        }
    }
    function ValidatePassword(value) {
